import{_ as s,v as o,b as n,R as a}from"./chunks/framework.a49639fc.js";const t="/experimental/images/token-factories/tokens_data.png",e="/experimental/images/token-factories/db_operation.png",q=JSON.parse('{"title":"Minting Your First Uniq","description":"","frontmatter":{"title":"Minting Your First Uniq","deploy":["staging","mainnet"],"order":6,"outline":[0,4]},"headers":[],"relativePath":"guides/Building Token Factories/mintingyourfirstuniq.md","filePath":"guides/Building Token Factories/mintingyourfirstuniq.md","lastUpdated":1697665158000}'),l={name:"guides/Building Token Factories/mintingyourfirstuniq.md"},i=a('<h1 id="minting-your-first-uniq" tabindex="-1">Minting your first Uniq <a class="header-anchor" href="#minting-your-first-uniq" aria-label="Permalink to &quot;Minting your first Uniq&quot;">​</a></h1><h2 id="let-s-gooooo" tabindex="-1">Let&#39;s Gooooo! <a class="header-anchor" href="#let-s-gooooo" aria-label="Permalink to &quot;Let&#39;s Gooooo!&quot;">​</a></h2><p>Now that you have your Token Factory up and running, you are free to mint some Uniqs. Exciting times are ahead!</p><h3 id="token-factory-information" tabindex="-1">Token Factory Information <a class="header-anchor" href="#token-factory-information" aria-label="Permalink to &quot;Token Factory Information&quot;">​</a></h3><p>As with the Token Factory, there is some specific data that you must include in the command.</p><ul><li><code>&lt;YOUR UNIQ URL&gt;</code> - The URL of the metadata either as a zip file, or targeting the <code>X.json</code> file with a full path</li><li><code>&lt;YOUR META HASH&gt;</code> - The hash of the uniq, you can find this in <code>upload.json</code> in the <code>factory</code> block at the top</li></ul><p>You can find these in the <code>upload.json</code> file and they will look something like this:</p><p><img src="'+t+'" alt=""></p><p>You will also need your <code>&lt;FACTORY ID&gt;</code>.</p><p>The easiest way to get this information is to:</p><ol><li>Go to your account on the <a href="https://explorer.testnet.ultra.io" target="_blank" rel="noreferrer">Block Explorer</a></li><li>Scroll down to the transactions and open the <code>create</code> action</li><li>On the left, you can see DB Operations</li></ol><p>In the DB Operations section you&#39;ll see some information. Most pertinent to you is the <code>UPDATE ROW</code> which actually holds your Token Factory id.</p><p><img src="'+e+`" alt=""></p><h3 id="accounts" tabindex="-1">Accounts <a class="header-anchor" href="#accounts" aria-label="Permalink to &quot;Accounts&quot;">​</a></h3><p>You&#39;ll also, of course, need to input <code>&lt;YOUR ACCOUNT&gt;</code> and the <code>&lt;TARGET ACCOUNT&gt;</code> which will receive the new Uniq.</p><h3 id="the-issue-action" tabindex="-1">The Issue Action <a class="header-anchor" href="#the-issue-action" aria-label="Permalink to &quot;The Issue Action&quot;">​</a></h3><p>Once you have the required information, minting is a simple, straightforward transaction via cleos.</p><div class="language-sh"><button title="Copy Code" class="copy"></button><span class="lang">sh</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#FFCB6B;">cleos</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">--url</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">http://ultratest.api.eosnation.io</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">push</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">action</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">eosio.nft.ft</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">issue.b</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&#39;</span><span style="color:#C3E88D;">[</span></span>
<span class="line"><span style="color:#C3E88D;">  {</span></span>
<span class="line"><span style="color:#C3E88D;">    &quot;to&quot;: &quot;&lt;TARGET ACCOUNT&gt;&quot;,</span></span>
<span class="line"><span style="color:#C3E88D;">    &quot;token_configs&quot;: [</span></span>
<span class="line"><span style="color:#C3E88D;">      {</span></span>
<span class="line"><span style="color:#C3E88D;">        &quot;token_factory_id&quot;: &lt;FACTORY ID&gt;,</span></span>
<span class="line"><span style="color:#C3E88D;">        &quot;amount&quot;: 1,</span></span>
<span class="line"><span style="color:#C3E88D;">        &quot;custom_data&quot;: &quot;&quot;</span></span>
<span class="line"><span style="color:#C3E88D;">      }</span></span>
<span class="line"><span style="color:#C3E88D;">    ],</span></span>
<span class="line"><span style="color:#C3E88D;">    &quot;memo&quot;: &quot;Your first Uniq!&quot;,</span></span>
<span class="line"><span style="color:#C3E88D;">    &quot;authorizer&quot;: null,</span></span>
<span class="line"><span style="color:#C3E88D;">    &quot;maximum_uos_payment&quot;: null,</span></span>
<span class="line"><span style="color:#C3E88D;">    &quot;token_metadata&quot;: [</span></span>
<span class="line"><span style="color:#C3E88D;">      {</span></span>
<span class="line"><span style="color:#C3E88D;">        &quot;meta_uri&quot;: &quot;&lt;YOUR UNIQ URI&gt;&quot;,</span></span>
<span class="line"><span style="color:#C3E88D;">        &quot;meta_hash&quot;:&quot;&lt;YOUR META HASH&gt;&quot;</span></span>
<span class="line"><span style="color:#C3E88D;">      }</span></span>
<span class="line"><span style="color:#C3E88D;">    ]</span></span>
<span class="line"><span style="color:#C3E88D;">  }</span></span>
<span class="line"><span style="color:#C3E88D;">]</span><span style="color:#89DDFF;">&#39;</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">-p</span><span style="color:#A6ACCD;"> </span><span style="color:#89DDFF;">&lt;</span><span style="color:#C3E88D;">YOUR</span><span style="color:#A6ACCD;"> </span><span style="color:#C3E88D;">ACCOUN</span><span style="color:#A6ACCD;">T</span><span style="color:#89DDFF;">&gt;</span></span></code></pre></div><p>Congratulations! You&#39;ve now minted your first Uniq on Ultra&#39;s Testnet!</p>`,19),p=[i];function r(c,u,h,d,y,C){return o(),n("div",null,p)}const D=s(l,[["render",r]]);export{q as __pageData,D as default};
